The last kiss
was never meant to be the last,
I just wanted it to last.
It all happened so fast;
Your indifference left me aghast.
All the memories we amassed,
Impossible to forget the past;
The pain that i feel, the pain that will outlast,
Every Little memory, a little bomb blast.
As if each blow was deadlier than the last.
The last kiss was never meant to be the last.
I just don't want it to last.
To forget the past and 
The memories to be extract
What a blessing it would be?, at last
To blot out
The last kiss.

